const FEEDBACK_INPUT ='FEEDBACK_INPUT'

const initialState = {
	newFeedback: {
    text:''
}
}

const feedbackReducer = (state = initialState, action) => {
  switch (action.type) {
	case FEEDBACK_INPUT:
	  console.log(state)
	  return state;
	default:
	  return state;

  }
}
export default feedbackReducer;
